import axios from 'axios';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Addplayer() {
  let navigate=useNavigate()
    const [player, setplayer] = useState({
        playerid: "",
        playername: "",
        teamid: "",
        age: "",
        role: ""
    });

    const {playerid, playername, teamid, age,role } = player;

    const onInputChange = (e) => {
        setplayer({ ...player, [e.target.name]: e.target.value });
        console.log("Updated player state:", player);
    };

    const onSubmit = async (e) => {
        e.preventDefault();
        try {
          await axios.post("http://localhost:8080/player", player);
          navigate("/player"); // Navigate to home after submitting
        } catch (error) {
          if (error.response) {
            // The request was made and the server responded with a status code
            // that falls out of the range of 2xx
            console.error("Server responded with an error:", error.response.data);
            alert(`Error: ${error.response.data.message || 'Something went wrong!'}`);
          } else if (error.request) {
            // The request was made but no response was received
            console.error("No response received:", error.request);
            alert('Error: No response received from the server.');
          } else {
            // Something happened in setting up the request that triggered an Error
            console.error("Error setting up the request:", error.message);
            alert(`Error: ${error.message}`);
          }
        }
      };
      

    return (
        <form onSubmit={(e)=> onSubmit(e)}>
            <div className="row g-3">
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Player id"
                        name="playerid"
                        value={playerid}
                        onChange={onInputChange}
                        aria-label="Player id"
                    />
                </div>
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Player name"
                        name="playername"
                        value={playername}
                        onChange={onInputChange}
                        aria-label="Player name"
                    />
                </div>
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Team id"
                        name="teamid"
                        value={teamid}
                        onChange={onInputChange}
                        aria-label="Team id"
                    />
                </div>
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Age"
                        name="age"
                        value={age}
                        onChange={onInputChange}
                        aria-label="Age"
                    />
                </div>
                <div className="col-sm">
                <input
                        type="text"
                        className="form-control"
                        placeholder=""
                        name="age"
                        value={age}
                        onChange={onInputChange}
                        aria-label="Age"
                    />
                </div>
                <div className="col-auto">
                    <button type="submit" className="btn btn-outline-danger mt-2">Submit</button>
                </div>
            </div>
        </form>
    );
}
